INSERT INTO `info` (`id`, `company_name`, `slogan`, `logo`, `about`, `mission`, `vision`) VALUES
(1, 'Polytechnic University of the Philippines', 'A website wherein you can look for Partner Companies under Polytechnic University of the Philippines.', '../img/pup-logo.png', 'Welcome to the Polytechnic University of the Philippines Partner Companies Portal, your directory of industry partners. Our website connects PUP students, faculty, and alumni with industry professionals for collaboration, networking, and innovation. Discover partner companies profiles, products, and services, and explore opportunities for internships, research, and community engagement. ', 'Our mission is to provide a comprehensive platform that showcases the partnerships between the Polytechnic University of the Philippines and its partner companies. Our website provides accurate and up-to-date information on our partner companies, highlighting the benefits of these partnerships to students, faculty, and the Polytechnic University of the Philippines and its partner companies. Our website provides accurate and up-to-date information on our partner companies, highlighting the benefits of these partnerships to students, faculty, and the public.', 'Our vision is to be the go-to resource for information on the Polytechnic University of the Philippines Partner companies.  Our website creates a dynamic online community that fosters connections, promotes innovation, and inspires growth. By facilitating collaboration and knowledge-sharing between the Polytechnic University of the Philippines and its industry partners, we strive to be a catalyst for economic development and social progress.');
